import React, { useState, useEffect } from "react";
import config from "../config";
import { MapContainer } from 'react-leaflet/MapContainer'
import { Marker } from 'react-leaflet/Marker'
import { Popup } from 'react-leaflet/Popup'
import { TileLayer } from 'react-leaflet/TileLayer'
import 'leaflet/dist/leaflet.css'
import L from 'leaflet';

const URL = `${config.WEBSOCKET_URL}`;
let connect_message = '{"type": "join", "id": "user id", "username": "username"}';
const markerIcon = new L.Icon({
    iconUrl: require("../assets/images/shrek.png"),
    iconSize: [100, 100],
    iconAnchor: [17, 46], //[left/right, top/bottom]
    popupAnchor: [0, -46], //[left/right, top/bottom]
  });

  let count = 0;

const Flights = () => {
    const [ws, setWs] = useState(new WebSocket(URL));
    // const [message, setMessage] = useState([]);
    // const [messages, setMessages] = useState([]);
    const [flights, setFlights] = useState({});
    const [flights2, setFlights2] = useState([]);

    useEffect(() => {
	    ws.onopen = () => {
	      console.log('WebSocket Connected');
        ws.send(connect_message);
	    }

        ws.onmessage = function (event) {
            const message = JSON.parse(event.data);
            try {
                if (message.hasOwnProperty("flights")) {

                    setFlights(message["flights"]);
                    setFlights2(Object.keys(flights));

                    // Object.keys(flights).forEach(id => {
                    //     // console.log(flights[id].departure);
                    //     console.log(flights[id].departure.location["lat"]);
                    //     // console.log(flights[id]);
                    // });

                    // Object.keys["flight"].map((element, index) => {
                    //   console.log(index);
                    // });
                    flights2.map((element, index) => {
                      console.log(flights[flights2[0]].departure.location["lat"]);
                      console.log(flights);
                    })
                }

                // if (message.hasOwnProperty("plane")) {
                //     console.log(message["plane"]);
                // }

                // if (message.hasOwnProperty("take-off")) {
                //     console.log(message["take-off"]);
                // }

                // if (message.hasOwnProperty("landing")) {
                //     console.log(message["landing"]);
                // }

                // if (message.hasOwnProperty("crashed")) {
                //     console.log(message["crashed"]);
                // }

                // if (message.hasOwnProperty("message")) {
                //     console.log(message["message"]);
                // }

            } catch (err) {
                // whatever you wish to do with the err
            }

            };

	    return () => {
	      ws.onclose = () => {
	        console.log('WebSocket Disconnected');
	        setWs(new WebSocket(URL));
	      }
	    }
  	}, [ws.onmessage, ws.onopen, ws.onclose]);
    return (
        <div className="map">
            <MapContainer center={[51.505, -0.09]} zoom={1} scrollWheelZoom={false}>
                <TileLayer
                    attribution='&copy; <a href="https://www.openstreetmap.org/copyright">OpenStreetMap</a> contributors'
                    url="https://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png"
                />
                <Marker position={[flights[flights2[0]].departure.location["lat"], -0.09]} icon={markerIcon}>
                  <Popup>
                  A pretty CSS3 popup. <br /> Easily customizable.
                  </Popup>
              </Marker>
                {flights2.map((element, index) => {
                  <Marker position={[51.505, -0.09]} key={count} icon={markerIcon}>
                    {count += 1}
                    <Popup>
                    A pretty CSS3 popup. <br /> Easily customizable.
                    </Popup>
                  </Marker>
                })

                }
            </MapContainer>
        </div>
    )
}

export default Flights;
